/** 
 * Constructs a new instance of the  {@link PredicateEvalInfo} class with thespecified detailed predicate evaluation information.
 * @param decision The decision number
 * @param input The input token stream
 * @param startIndex The start index for the current prediction
 * @param stopIndex The index at which the predicate evaluation wastriggered. Note that the input stream may be reset to other positions for the actual evaluation of individual predicates.
 * @param semctx The semantic context which was evaluated
 * @param evalResult The results of evaluating the semantic context
 * @param predictedAlt The alternative number for the decision which isguarded by the semantic context  {@code semctx}. See  {@link #predictedAlt}for more information.
 * @param fullCtx {@code true} if the semantic context wasevaluated during LL prediction; otherwise,  {@code false} if the semanticcontext was evaluated during SLL prediction
 * @see ParserATNSimulator#evalSemanticContext(SemanticContext,ParserRuleContext,int,boolean)
 * @see SemanticContext#eval(Recognizer,RuleContext)
 */
public PredicateEvalInfo(int decision,TokenStream input,int startIndex,int stopIndex,SemanticContext semctx,boolean evalResult,int predictedAlt,boolean fullCtx){
  super(decision,new ATNConfigSet(),input,startIndex,stopIndex,fullCtx);
  this.semctx=semctx;
  this.evalResult=evalResult;
  this.predictedAlt=predictedAlt;
}
